INSERT INTO `tbl_adv` VALUES (27,1,7,'胖妮（测试）','1','胖妮烧烤','','<p>我们专注烧烤和面食，给你最接近国内的味道。</p><p><b>营业时间：</b><br></p><p>周二休息</p><p>我们会的服务可以为您持续到到打烊后1小时，请您在用餐时安排好时间。</p>','','/uploads/2018/10/22/2018102222213995146.jpg,/uploads/2018/10/22/2018102222221533138.jpg,/uploads/2018/10/22/2018102222225543458.jpg,/uploads/2018/10/22/2018102222233074970.jpg',1,1,5,1,0.01,0.05,'',0.04,0.01,3,5101,130,NULL,'2018-10-22 22:20:44','2018-10-22 22:20:44'),(28,2,7,'禾悦旅游（测试）','1','','/uploads/2018/10/22/2018102222320062558.jpg','<p style=\"text-align: justify;\"><span style=\"color: rgb(53, 53, 58);\">看享有</span><span style=\"color: rgb(53, 53, 58);\">“世界游艇之都”盛名的罗德岱堡，逛巴哈马首都––梦幻都市拿骚，闯第一个允许游客访问的私人岛屿–-大马镫礁，去大沼泽公园体验“草上飞”穿梭在鳄鱼密布的沼泽河流，深入沼泽地体验自然奇景，看动物表演，去Bloomingdale’s购物···<br>酒店游轮穿插住宿，让你享受一次不一样的海上之旅，面朝大海，春暖花开，快和我们一起去海上吹吹风！</span><b></b></p><p style=\"margin-left: 0cm; text-align: justify;\"><b><span style=\"color: black;\">2017年感恩节-游轮主题团行程亮点&nbsp;&nbsp;</span></b></p><ol><li>北美留学生专属主题团<br></li><li>两晚海滩度假酒店，三晚轻奢游轮阳台房<span style=\"color: black;\"></span><br><span style=\"color: black;\"></span></li></ol><p><span style=\"color: black;\"></span><br><span style=\"color: black;\">征服对沼泽的恐惧，</span><span style=\"color: rgb(53, 52, 52);\">乘坐“草上飞”风力船在沼泽中乘风破浪，</span><span style=\"color: black;\">感受沼泽奇景深入沼泽内部，与鳄鱼零距离接触<br><br></span></p><ol><li><span style=\"color: black;\"></span><span style=\"color: black;\">畅游阳光海滨之城——迈阿密，追随施瓦辛格的脚步抵达天涯海角</span><span style=\"color: black;\"><br></span></li><li><span style=\"color: black;\"></span><span style=\"color: black;\">体味拿骚中古海盗时期与二十世纪梦幻都市身临皇家赌场</span></li><li><span style=\"color: black;\"></span><span style=\"color: black;\">JoyTravel为你提供独家机会领略私人岛屿——大马镫礁的神秘</span></li></ol>','','/uploads/2018/10/22/2018102222360595978.jpg,/uploads/2018/10/22/2018102222360770640.jpg,/uploads/2018/10/22/2018102222361095909.jpg',1,5,15,1,0.01,0.15,'',0.13,0.02,2,7443,52,NULL,'2018-10-22 22:37:10','2018-10-22 22:37:10'),(34,1,1374,'布丁','Dfwcomputer ','电脑维修','','<p>有需要电脑维修的/网络问题的可小窗联系 价格公道 没车的如果不远 可上门服务。意者可加微信：Dfwcomputer<br></p>','','',1,4,1,1,20.00,20.00,'',17.00,3.00,3,3802,19,NULL,'2018-10-26 02:49:11','2018-10-26 02:48:57'),(35,1,1025,'Github','https://github.com','交友','','<p><span style=\"color: rgb(88, 96, 105);\">We’re supporting a community where more than 31 million</span><span style=\"color: rgb(88, 96, 105);\">*</span><span style=\"color: rgb(88, 96, 105);\">&nbsp;people learn, share, and work together to build software.</span><br></p>','https://github.com','',1,4,1,1,20.00,0.00,'',0.00,0.00,1,281,0,NULL,NULL,'2018-11-05 23:50:58'),(36,1,7,'测试下','13645453453','快餐六六','','<p><b>是否收费的</b></p><ol><li>风刀霜剑分手快乐甲方</li><li>的甲方是否</li><li>多喝酸奶</li></ol>','','/uploads/2018/11/6/2018110607335039103.jpg,/uploads/2018/11/6/2018110607335442974.jpg,/uploads/2018/11/6/2018110607335744026.jpg',1,1,1,1,140.00,0.00,'',0.00,0.00,2,7,1,NULL,NULL,'2018-11-06 07:35:18'),(37,1,49,'Test','Test','Test','','<p>Test</p>','','',1,1,2,2,140.00,0.00,'',0.00,0.00,-1,1,0,NULL,NULL,'2018-11-07 06:58:44'),(38,2,1025,'Github','18983551461','','http://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/11/25/201811250957011922.jpg','<p>111</p>','','',1,5,1,1,120.00,0.00,'',0.00,0.00,1,196,3,NULL,NULL,'2018-11-25 09:57:12'),(39,2,1025,'Github','18983551461','','http://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/11/25/201811250957011922.jpg','<p>111</p>','','',1,5,1,1,120.00,120.00,'',102.00,18.00,0,0,0,NULL,NULL,'2018-11-25 10:05:02'),(40,1,1025,'111','222','3334','','<p>44</p>','','',1,4,1,1,20.00,20.00,'',17.00,3.00,-1,0,0,NULL,NULL,'2018-11-25 10:22:21'),(41,1,1025,'111','222','111','','<p>111</p>','','',4,4,1,1,2.00,2.00,'',1.70,0.30,-1,0,0,NULL,NULL,'2018-11-26 00:00:43'),(42,1,7,'胖妮烧烤','2342','胖妮烧烤','','<p>专注烧烤和面食，给你最接近国内的味道。<br></p><p>英文名： Fat Ni BBQ&nbsp;&nbsp;</p><p><b>地址：</b>2001 Coit Road, Plano, TX, 75075</p><p><b>营业时间：</b></p><p>星期日-星期四&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;11：30am-11:00pm</p><p>星期五-星期六&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&n