INSERT INTO `tbl_article` VALUES (1,0,1,1,'关于秒Po','','','<p>&ldquo;秒Po&rdquo;是中国学生的极简信息发布平台。平台以各校区独立运营、免注册极简发布等模式，让学生间的信息交互更加简洁、高效和相对安全，有效解决聊天群信息分散、大众平台繁琐杂乱等问题。</p>\r\n\r\n<p>欢迎大家关注请我们的微信、微博、Facebook官方账户：</p>\r\n\r\n<p><strong>微信公众号：&ldquo;秒Po&rdquo;</strong></p>\r\n\r\n<p><img alt=\"\" src=\"data:image/jpeg;base64,\" style=\"height:191px; width:191px\" /></p>\r\n\r\n<p><strong>微博官方账号：<ins><a href=\"https://weibo.com/u/6517278112?refer_flag=1001030101_&amp;is_hot=1\">&ldquo;秒Po&rdquo; </a></ins></strong></p>\r\n\r\n<p><strong>Facebook官方账号：<ins><a href=\"https://www.facebook.com/miaopost/\">&ldquo;秒Po&rdquo;</a></ins></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>联系方式：miaopost@126.com</p>',3,0,'2018-04-08 19:36:54'),(15,0,1,1,'意见建议','','','<p>欢迎大家提出任何意见建议，帮助我们更好地为同学们服务。</p>\n\n<p>反馈方式一：向小助手反馈（微信）</p>\n\n<p><img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/5/19/201805190118551194.jpg\" style=\"height:200px; width:200px\" /></p>\n\n<p>反馈方式二：通过下方输入框提交</p>',2,0,'2018-05-19 01:20:05'),(18,0,3,0,'','','','<p><strong>您好！ 欢迎使用秒Po广告系统投放广告！ </strong></p>\r\n\r\n<p>发布极简广告请点击本页下方按钮：&ldquo;列表页广告&rdquo;、&ldquo;详情页广告&rdquo;。</p>\r\n\r\n<p>在发布前，请允许我向您介绍极简广告及另外互补的两种广告形式，以便根据您的具体需求，选择更实惠有效的广告方案。秒Po广告体系包含三种互补的广告形式：免费分类广告、红包广告、极简广告。下面依次向您介绍。</p>\r\n\r\n<p><strong>1. 免费分类广告</strong></p>\r\n\r\n<p><strong>特点：</strong>免费、高效，适用于符合特定分类的广告内容。</p>\r\n\r\n<p>秒Po为本地商家设置了可以免费进行宣传的分类，如&ldquo;周边好评&rdquo;、&ldquo;优惠折扣&rdquo;、&ldquo;建群加群&rdquo;。可以在&ldquo;周边好评&rdquo;分类中详尽介绍自己的服务，如果结合留言红包使用还可以鼓励大家通过留言给出好评；可以在&ldquo;优惠折扣&rdquo;分类中发布最新的优惠信息，留言和及时推送回复的功能，可以用来为前多少名留言的用户发放优惠券；还可以利用&ldquo;建群加群&rdquo;分类建立自己店铺的顾客群，更好地获得新顾客和维护老顾客。</p>\r\n\r\n<p><strong>2. 红包广告</strong></p>\r\n\r\n<p><strong>特点：</strong>适用于将广告迅速推向一定数量的用户。</p>\r\n\r\n<p>如果您希望将您的广告迅速推向一定数量的用户，则红包广告是最优选择。可以在发布信息时加入&ldquo;阅读红包&rdquo;或&ldquo;留言红包&rdquo;，您的发布就会置顶显示，并且有红包标志吸引大家阅读或留言。</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241213289479.png\" style=\"height:267px; width:218px\" />&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241214067891.png\" style=\"height:223px; width:513px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. 极简广告</strong></p>\r\n\r\n<p><strong>特点：</strong>适用于长期展示自身转化率较高的广告。</p>\r\n\r\n<p>极简广告分为&ldquo;信息列表信息广告&rdquo;和&ldquo;信息详情页图片广告&rdquo;，点进两种形式的广告后都进入广告的图文介绍页，或者进入您自己的网站。极简广告按照每千次展示收费，每千次展示从20元人民币到140元人民币不等。您可以通过微信即时接收到用户的留言推送并可以随查看广告已投放量。广告展示效果如下：</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241217487597.png\" style=\"height:497px; width:798px\" /></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241219515600.png\" style=\"height:554px; width:794px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>希望通过电脑编辑广告的用户，可以通过秒Po网址miaopost.com来访问我们。我们现在还不完美，不过我们的技术团队正在加班加点优化我们的产品和开发更便捷的功能，希望得到您的支持和信任！任何问题都可以咨询秒Po小助手，小助手微信号：post226 (也可直接扫描下方二维码添加）</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241226576710.jpg\" style=\"height:200px; width:200px\" /></strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>',0,0,'2018-08-26 15:55:26'),(21,0,1,1,'广告合作','','','<p>&nbsp;</p>\n\n<p>秒Po致力于围绕校园打造最简单好用的信息发布平台，以极简模式和更贴近实际需求的多种创新方案，让广大同学及校园周边居民的生活更加便利。</p>\n\n<p>同时，为了让广大商家不再为校园宣传而头疼，我们设计了极简的广告系统&mdash;&mdash;投放更简便，价格更合理，效果更明显。具体说来，秒Po设置了以下三种互补的广告形式：</p>\n\n<p><strong>1. 免费分类广告</strong></p>\n\n<p><strong>特点：</strong>免费、高效，适用于符合特定分类的广告内容。</p>\n\n<p>秒Po为本地商家设置了可以免费进行宣传的分类，如&ldquo;周边好评&rdquo;、&ldquo;优惠折扣&rdquo;、&ldquo;建群加群&rdquo;。可以在&ldquo;周边好评&rdquo;分类中详尽介绍自己的服务，如果结合留言红包使用还可以鼓励大家通过留言给出好评；可以在&ldquo;优惠折扣&rdquo;分类中发布最新的优惠信息，留言和及时推送回复的功能，可以用来为前多少名留言的用户发放优惠券；还可以利用&ldquo;建群加群&rdquo;分类建立自己店铺的顾客群，更好地获得新顾客和维护老顾客。</p>\n\n<p><strong>2. 红包广告</strong></p>\n\n<p><strong>特点：</strong>适用于将广告迅速推向一定数量的用户。</p>\n\n<p>如果您希望将您的广告迅速推向一定数量的用户，则红包广告是最优选择。可以在发布信息时加入&ldquo;阅读红包&rdquo;或&ldquo;留言红包&rdquo;，您的发布就会置顶显示，并且有红包标志吸引大家阅读或留言。</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241213289479.png\" style=\"height:267px; width:218px\" />&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241214067891.png\" style=\"height:223px; width:513px\" /></p>\n\n<p>&nbsp;</p>\n\n<p><strong>3. 极简广告</strong></p>\n\n<p><strong>特点：</strong>适用于长期展示自身转化率较高的广告。</p>\n\n<p>极简广告分为&ldquo;信息列表信息广告&rdquo;和&ldquo;信息详情页图片广告&rdquo;，点进两种形式的广告后都进入广告的图文介绍页，或者进入您自己的网站。极简广告按照每千次展示收费，每千次展示从20元人民币到140元人民币不等。您可以通过微信即时接收到用户的留言推送并可以随查看广告已投放量。</p>\n\n<p><strong>发布方式：</strong>从秒Po首页点击发布按钮，选择&ldquo;极简广告&rdquo;</p>\n\n<p>&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241217487597.png\" style=\"height:497px; width:798px\" />&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241219515600.png\" style=\"height:574px; width:823px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>希望通过电脑编辑广告的用户，可以秒Po网址miaopost.com来访问我们。我们现在还不完美，不过我们的技术团队正在加班加点优化我们的产品和开发更便捷的功能，希望得到您的支持和信任！任何问题都可以咨询秒Po小助手，小助手微信号：post226 (也可直接扫描下方二维码添加）</p>\n\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"https://miaopost.oss-cn-hangzhou.aliyuncs.com/prod/uploads/2018/10/24/201810241226576710.jpg\" style=\"height:200px; width:200px\" /></strong></p>\n\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>',1,0,'2018-10-24 12:27:19');
