  `orderno` varchar(128) NOT NULL COMMENT '订单号',
  `uid` int(11) NOT NULL COMMENT '用户id',
  `username` varchar(64) DEFAULT NULL COMMENT '用户名称',
  `pay_type` int(1) NOT NULL COMMENT '支付类型:1微信，2支付宝',
  `status` int(1) NOT NULL COMMENT '状态：0未支付，1已支付',
  `amount` decimal(11,2) NOT NULL COMMENT '金额',
  `transaction_id` varchar(128) NOT NULL COMMENT '业务id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=260 DEFAULT CHARSET=utf8 COMMENT='订单表';
